import React, { useState, useEffect} from 'react';
import Header from './Header.js';
import Modal from './Modal.js';

function TreeCover({info}) {
  console.log(info)
  return (
    <div className="wrapper">
      <Header name={info.name} element='treeCover' id={info.id} description={info.description} type={info.type} />

      <div id="treeCover">
      <div class="select-wrapper range">
        <div class="rangeslider">
            <span class="square">M<sup>2</sup></span>
            <div id="behaviour" class="behaviour"></div>
            <span id="slider-range-value1" class="val left"></span>
            <span id="slider-range-value2" class="val right"></span>
        </div>
    </div>
      </div>


      <Modal description={info.description} id={info.id} type={info.type}/>

    </div>
  )
}

export default TreeCover
